message: "كلنا لاحظنا مؤخراً ان مستوى ال posts اصبح اقل من توقعاتنا جميعاً, و ده بالتالي
  أدى لاجراءات مننا كمشرفين ضايقت بعض الأعضاء سواء لغلق التعليقات على مواضيع او حذفها
  و اللي بيكون أغلب الوقت بناءً على تبليغات من أعضاء آخرين عن المواضيع دي.\nو طبعاً
  مش محتاج أقول ان مش هدفنا اننا نضايق اي حد بشكل شخصي, لكن في النهاية احنا بنحاول
  نحافظ على واحد من اهم الاسباب اللي جذبت الاعضاء للجروب و هو مستوى المحتوى.\nفاحنا
  حنغير سياسة الجروب بشكل مؤقت باننا نعمل مراجعة لكل ال Posts قبل السماح بنشرها. \nو
  رجاء من الاعضاء مراجعة قواعد الجروب قبل مشاركة اي مواضيع."
